import React, { useState } from 'react';
import Navbar from './Navbar';
import Footer from './Footer';
import './AddCase.css';

const AddCase = () => {
    const [caseType, setCaseType] = useState('');
    const [description, setDescription] = useState('');
    const [province, setProvince] = useState('');
    const [date, setDate] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
        // Add your form submission logic here
        console.log({ caseType, description, province, date });
    };

    return (
        <div>
            <Navbar />
            <div className="add-case-background">
                <div className="add-case-container">
                    <h2 className="add-case-title">Add New Case</h2>
                    <form onSubmit={handleSubmit} className="add-case-form">
                        <div className="form-group">
                            <label htmlFor="caseType">Case Type</label>
                            <select
                                id="caseType"
                                value={caseType}
                                onChange={(e) => setCaseType(e.target.value)}
                            >
                                <option value="">Select Case Type</option>
                                <option value="civil">Civil</option>
                                <option value="criminal">Criminal</option>
                                <option value="family">Family</option>
                                <option value="labor">Labor</option>
                            </select>
                        </div>
                        <div className="form-group">
                            <label htmlFor="description">Description</label>
                            <textarea
                                id="description"
                                placeholder="Enter case description"
                                value={description}
                                onChange={(e) => setDescription(e.target.value)}
                            ></textarea>
                        </div>
                        <div className="form-group">
                            <label htmlFor="province">Province</label>
                            <select
                                id="province"
                                value={province}
                                onChange={(e) => setProvince(e.target.value)}
                            >
                                <option value="">Select Province</option>
                                <option value="central">Central Province</option>
                                <option value="eastern">Eastern Province</option>
                                <option value="northern">North Central Province</option>
                                <option value="southern">Northern Province</option>
                                <option value="western">North Western Province</option>
                                <option value="eastern">Sabaragamuwa Province</option>
                                <option value="northern">Northern</option>
                                <option value="southern">Southern</option>
                                <option value="western">Western</option>

                                Central Province
Eastern Province
North Central Province
Northern Province
North Western Province
Sabaragamuwa Province
Southern Province
Uva Province
Western Province
                            </select>
                        </div>
                        <div className="form-group">
                            <label htmlFor="date">Date</label>
                            <input
                                id="date"
                                type="date"
                                value={date}
                                onChange={(e) => setDate(e.target.value)}
                            />
                        </div>
                        <button type="submit" className="btn-primary">Submit</button>
                    </form>
                    <div className="data-protection">
                        <h3>We Protect Your Data</h3>
                        <p>Don't worry, we take your data privacy seriously and ensure it's protected.</p>
                    </div>
                </div>
            </div>
            <Footer />
        </div>
    );
};

export default AddCase;
